import React from "react";
//! import axios from "axios";

export default function Modal() {
  return (
    <div class="modal">
      <div class="modal_text">
        <p class="modal_p">모달창</p>
        <span class="modal_span">정상적으로 처리되었습니다.</span>
      </div>
      <div class="modal_x">닫기</div>
    </div>
  );
}
